import "./Acordian.css"
const data = [
    { id: 1, title: "A" },
    { id: 2, title: "B" },
    { id: 3, title: "C" },
    { id: 4, title: "D" },
]
function AcordianBody() {

    return <div className="mainBox">
        {data.map((item) => {
            return <div key={item.id} className="outBox">
                <div>{item.title}</div>
                <div>{">"}</div>
            </div>
        })}
    </div>
}
export default AcordianBody
